syntax = "proto3";

option java_package = "com.kedacom.ctsp.cvf.viid.common.protobuf";

import "src/main/proto/protobuf/nonmotorvehicle.proto";
import "src/main/proto/protobuf/timeconsuming.proto";

message NonMotorVehicleListObject{
	repeated NonMotorVehicle_Proto	NonMotorVehicleObject = 1;
	int64	TotalNum = 2;
	repeated TimeConsuming_Proto	TimeConsuming = 3;
}
